pub enum DecodeStringError<'a> {
    InvalidMarkerRead(Error),
    InvalidDataRead(Error),
    TypeMismatch(Marker),

    /// The given buffer is not large enough to accumulate the specified amount of bytes.
    BufferSizeTooSmall(u32),
    InvalidUtf8(&'a [u8], Utf8Error),
}

pub enum ValueReadError {

    /// Failed to read the marker.
    InvalidMarkerRead(Error),

    /// Failed to read the data.
    InvalidDataRead(Error),

    /// The type decoded isn't match with the expected one.
    TypeMismatch(Marker),
}

pub enum NumValueReadError {

    /// Failed to read the marker.
    InvalidMarkerRead(Error),

    /// Failed to read the data.
    InvalidDataRead(Error),

    /// The type decoded isn't match with the expected one.
    TypeMismatch(Marker),

    /// Out of range integral type conversion attempted.
    OutOfRange,
}

pub enum ValueWriteError {

    /// I/O error while writing marker.
    InvalidMarkerWrite(Error),

    /// I/O error while writing data.
    InvalidDataWrite(Error),
}
